 time! For example, in Australia, if you spend $16,000 on a solar set up, they will rebate you up to $8000 back. This doesn't include other rebates you can get either. You'll need to check your own country's government policies - but, in the next 5-10 years - all countries will be jumping on the solar bandwagon.<\/p><h3>Not Just A 'One Time' Set Up + Easy Installation<\/h3><p>With solar, you don't need to invest into a bunch of costly arraysrightaway. You're able to set up one panel at a time, and add additional panels whenever you feel the time is right. Furthermore,installing a solar panel is actually quite a lot easier than peoplethink. You can do it yourself, or have an installer come and have itset up for you the same day.<\/p><\/div>",wY='<gwt:clipper style="',VU='<html><body onload="if(parent.__gwt_onHistoryLoad)parent.__gwt_onHistoryLoad(__gwt_historyToken.innerText)"><div id="__gwt_historyToken">',DY="<img onload='this.__gwtLastUnhandledEvent=\"load\";' src='",bT='=',uT='>',$X='?',WQ='@',wX='A PotentialElement cannot be resolved twice.',wS='A request timeout has expired after ',_Q='ABQIAAAAG8LzhtshQCjpSshU_uJjmxTBfUk9TZrBRaIteybtnU2KziHEpRQvhPNTjo7DMczjrRD3yBPRJ_BSQQ',$Q='ABQIAAAAG8LzhtshQCjpSshU_uJjmxTwM0brOpm-All5BF6PoaKBxRWWERTZER2lJ4GnsG8nvhKLOQ20degaEQ',$$='AGL',XY='AREA',g4='AbsolutePanel',P2='AbstractCollection',D5='AbstractDataTable$ColumnType',F5='AbstractDataTable$ColumnType;',q6='AbstractHashMap',r6='AbstractHashMap$EntrySet',s6='AbstractHashMap$EntrySetIterator',u6='AbstractHashMap$MapEntryNull',v6='AbstractHashMap$MapEntryString',U4='AbstractList',w6='AbstractList$IteratorImpl',x6='AbstractList$ListIteratorImpl',M2='AbstractMap',y6='AbstractMap$1',z6='AbstractMap$1$1',t6='AbstractMapEntry',f3='AbstractRenderer',F3='AbstractSerializationStream',G3='AbstractSerializationStreamReader',H3='AbstractSerializationStreamWriter',Q2='AbstractSet',LT='ActiveXObject',gT='Add not supported on this collection',pZ='Add not supported on this list',Q0='AjaxKeyC
